import styled from "styled-components";

const StrongContainer = styled.div`
width: 100%;
height: 14.8rem;
margin-top: 1.6rem;
text-align: center;
line-height: 14.8rem;
color: #bfbfbf;
font-size: 1.4rem;
`;

const StrongItem = styled.div`
width: 23.2rem;
height: 2.5rem;
margin-bottom: 0.5rem;

&:nth-child(5) {
    margin-bottom: 0;
}
`;

function StrongTest () {
    return (
        <StrongContainer>
            <StrongItem>100</StrongItem>
            <StrongItem>100</StrongItem>
            <StrongItem>100</StrongItem>
            <StrongItem>100</StrongItem>
            <StrongItem>100</StrongItem>
        </StrongContainer>
    )
}

function StrongTestA () {
    return (
        <div className="strong-container">
            나의 강점 테마 Top5를 알려주세요!
        </div>
    )
}

export default StrongTest;
